import React, { useState } from "react";

const Mouse = () => {
  const mouse =
    useState[
      {
        height: "70px",
        width: "70px",
        borderRadius: 300,
        border: "2px solid red",
        position: "absolute"
      }
    ];

  return (
    <div>
      <div className="circle" style={mouse}></div>
    </div>
  );
};

export default Mouse;
